strings:
"SVDialogDefaultBrowserAppMessage" : "Необходимо сбросить текущие настройки браузера по умолчанию.

1) Нажмите кнопку "Далее";
2) В новом окне нажмите кнопку "Удалить настройки по умолчанию";
3) Вернитесь в настройки приложения и снова переместите переключатель."

"SVDialogDefaultBrowserAppMessage" : "You have to discard current setting of default browser.

1) Tap on button "Next";
2) In a new window tap on button "Clear default settings";
3) Back to the app and switch default browser option on."
